"use strict";
const cero = (func) => func ? func(0) : 0;
const uno = (func) => func ? func(1) : 1;
const dos = (func) => func ? func(2) : 2;
const tres = (func) => func ? func(3) : 3;
const cuatro = (func) => func ? func(4) : 4;
const cinco = (func) => func ? func(5) : 5;
const seis = (func) => func ? func(6) : 6;
